//  <!-- displayData function for dynamic  -->
function displayData(data, container) {
  container.innerHTML = "";
  data.map((ele) => {
    let div = document.createElement("div");
    let imageM = document.createElement("img");
    imageM.src = ele.img;
    let courseM = document.createElement("p");
    courseM.innerHTML = "COURSE";
    let titleM = document.createElement("p");
    titleM.innerHTML = ele.title;
    let createrM = document.createElement("p");
    createrM.innerHTML = `By: ${ele.creater}`;
    let decriptionM = document.createElement("p");
    decriptionM.innerHTML = `${ele.decription}`;
    decriptionM.setAttribute("id","des");
    div.addEventListener("click", () => {
      localStorage.setItem("productData", JSON.stringify(ele));
      window.location.href = "product_details_page.html";
    });
    div.append(imageM, courseM, titleM, createrM, decriptionM);
    container.append(div);
  });
}
//  <!-- slide function for dynamic  -->

function slide(id_append_con, id_prevbtn, id_nextbtn, product_datas) {
  let container = document.getElementById(id_append_con);
  displayData(product_datas, container);
  let val = `#${id_append_con} div`;
  console.log("val:", val);

  let container_div = document.querySelectorAll(val);

  const prevbtn = document.getElementById(id_prevbtn);
  const nextbtn = document.getElementById(id_nextbtn);
  let counter = 0;
  const size = 300;
  if (counter == 0) {
    prevbtn.style.color = "rgba(207, 207, 207, 0.781)";
    prevbtn.style.borderColor = "rgba(207, 207, 207, 0.781)";
  }

  nextbtn.addEventListener("click", () => {
    if (counter > container_div.length - 6) {
      nextbtn.style.color = "rgba(207, 207, 207, 0.781)";
      nextbtn.style.borderColor = "rgba(207, 207, 207, 0.781)";
      return;
    }
    counter += 1;
    if (counter != 0) {
      prevbtn.style.color = "gray";
      prevbtn.style.borderColor = "gray";
    }

  
    container.style.transition = "1s";
    container.style.transform = "translateX(" + -size * counter + "px)";
  });
  prevbtn.addEventListener("click", () => {
    if (0 == counter) {
      prevbtn.style.color = "rgba(207, 207, 207, 0.781)";
      prevbtn.style.borderColor = "rgba(207, 207, 207, 0.781)";
      return;
    }
    counter -= 1;
    if (counter != 0) {
      nextbtn.style.color = "gray";
      nextbtn.style.borderColor = "gray";
    }
   
    container.style.transition = "1s";

    container.style.transform = "translateX(" + -size * counter + "px)";
  });
}

